def normalize_dist(d):
    # input diag matrix 
    for i in range(d.shape[0]):
        for j in range(d.shape[1]):
            if i!=j:
                d1 = d[i,i]  +  d[j,j] 
                d[i,j] =  d[i,j]*(2/d1)  # or the other way araound

    return d




